import { useState } from 'react';

function Main() {

  let product = [
    {name: 'product 1', description: 'some description here'}
  ];
  
  return ( 
    <div className="container mt-5">
      <div>
        {product?.map((singleProduct)=> (
          <div>
            {singleProduct.name}
            {singleProduct.description}
          </div>
        ))}
      </div>
    </div>
   );
}

export default Main;
